import './Navbar.css'

const scrollTo = (destination) => {
  console.log("scrolling")
  document.getElementById(destination)?.scrollIntoView();
}

export const Navigation = () => {
  return (
    <div className="nav-bar">
        <div className="nav-button-container">
            <button className="Home-Button" id="nav-bar-button" onClick={(e) => scrollTo("Home")}>Home</button>
            <button className="About-Button" id="nav-bar-button" onClick={(e) => scrollTo("About-title")}>About</button>
            <button className="Projects-Button" id="nav-bar-button" onClick={(e) => document.getElementById("Projects")?.scrollIntoView({block: "center"})}>Projects</button>
            {/* <button className="ContactMe-Button" id="nav-bar-button" onClick={(e) => scrollTo("ContactMe")}>ContactMe</button> */}
            <button className="Skills-Button" id="nav-bar-button" onClick={(e) => scrollTo("Skills")}>Skills</button>

        </div>

        <div className="emailme-button-wrapper">
          <button className="EmailMe-Button" onClick={(e) => scrollTo("Home")}>Home</button>

        </div>
    </div>
  );
};
